import './Admin.css'
import React, { useState, useEffect } from 'react';
import { addProject, getProject, deleteProject } from '../../services/projectCardService';
import { ProjectCard } from "../ProjectCard/ProjectCard";

export const ProjectCards = () => {
  const [project, setProject] = useState([]);
  const [newProject, setNewProject] = useState({ title: '', description: '', imageUrl: [], Hedimage: '' , demo: '' , video: ''  , github: '' , details: '' });

  useEffect(() => {
    fetchProject();
  }, []);

  const fetchProject = async () => {
    const data = await getProject();
    setProject(data);
  };

  const handleAddProject = async () => {
    const addedProject = await addProject(newProject);
    setProject([...project, addedProject]);
    setNewProject({ title: '', description: '', imageUrl: '', link: '' });
  };

  const handleDeleteCard = async (id) => {
    await deleteProject(id);
    setProject(project.filter((card) => card._id !== id));
  };

  return (
    <div >
      <h2>Project Cards</h2>
      <div>
        <input style={{ marginTop : "20px" , marginBottom : "20px"}}
          type="text"
          placeholder="Title"
          value={newProject.title}
          onChange={(e) => setNewProject({ ...newProject, title: e.target.value })}
        />
        <input style={{ marginTop : "20px" , marginBottom : "20px"}}
          type="text"
          placeholder="details"
          value={newProject.details}
          onChange={(e) => setNewProject({ ...newProject, details: e.target.value })}
        />
        <input style={{ marginTop : "20px" , marginBottom : "20px"}}
          type="text"
          placeholder="github"
          value={newProject.github}
          onChange={(e) => setNewProject({ ...newProject, github: e.target.value })}
        />
        <input
          type="text"
          placeholder="Description"
          value={newProject.description}
          onChange={(e) => setNewProject({ ...newProject, description: e.target.value })}
        />
        <input
          type="text"
          placeholder="Hedimage"
          value={newProject.Hedimage}
          onChange={(e) => setNewProject({ ...newProject, Hedimage: e.target.value })}
        />
        <input
          type="text"
          placeholder="video"
          value={newProject.video}
          onChange={(e) => setNewProject({ ...newProject, video: e.target.value })}
        />
        <input
          type="text"
          placeholder="demo"
          value={newProject.demo}
          onChange={(e) => setNewProject({ ...newProject, demo: e.target.value })}
        />

       <div>
                <label>Image URLs</label>
                <div>
                    <input
                        type="text"
                        placeholder="Add image URL"
                        value={imageUrlInput}
                        onChange={(e) => setImageUrlInput(e.target.value)}
                    />
                    <button type="button" onClick={handleAddImageUrl}>
                        Add URL
                    </button>
                </div>
                <ul>
                    {newCard.imageUrl.map((url, index) => (
                        <li key={index}>
                            {url}
                            <button type="button" onClick={() => handleRemoveImageUrl(index)}>
                                Remove
                            </button>
                        </li>
                    ))}
                </ul>
            </div>

        <button onClick={handleAddProject}>Add Project Card</button>
      </div>

      {
        project.map((project, card) => (
          <div key={card._id}>
            <ProjectCard
              title={project.title}
              details={project.details}
              Hedimage={project.Hedimage}
              link={project.link}
            />
            <button className = "pass" onClick={() => handleDeleteCard(card._id)}>Delete</button>
            </div>
          ))}
          </div>
  );
};
